public synchronized String getResourceKey() {
  LocalizationStatusProtoOrBuilder p = viaProto ? proto : builder;
  if (this.resourceKey != null) {
    return this.resourceKey;
  }
  if (!p.hasResourceKey()) {
    return null;
  }
  this.resourceKey = p.getResourceKey();
  return this.resourceKey;
}
